  Species = factor(c(rep("cyno",78),rep("dog",78),rep("mouse",78),rep("rat",78))),
  Tissues = factor(rep(c(rep("adipose",6),rep("adrenal",6),rep("brain",6),rep("colon",6),rep("heart",6),rep("liver",6),rep("lung",6),rep("muscle",6),rep("pituitary",6),rep("skin",6),rep("spleen",6),rep("testis",6),rep("thyroid",6)),4)),
